script: |
  super -f text -I q5127.spq | sort > q5127.out

inputs:
  - name: q5127.spq
    data: |
      SELECT ALL col0 + - 58 - + + col2 * 5 * + - col2 * col0 / col0 AS col0, CAST ( + 19 AS INTEGER ) * 88 * + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE + 35 IS NULL;
  - name: tab0

outputs:
  - name: q5127.out
    data: |
